import React from 'react';
import 'antd/dist/antd.css';
import {
  Drawer,
  Form,
  Input,
  Select,
  Row,
  Col,
  Icon,
  Steps,
  DatePicker ,
  Button,
  Layout
} from 'antd';
import moment from 'moment';

import {signin} from "../../middleware/users"

const { Option } = Select;
class VerifyMail extends React.Component {
  state = {
    confirmDirty: false,
    autoCompleteResult: [],
  };


  handleSubmit = e => {
    e.preventDefault();
    this.props.form.validateFieldsAndScroll((err, values) => {
      if (!err) {
        console.log(this.props.value)
        this.props.value.secretKey=values.secretKey
        let response=signin(

            {

                "first_name": this.props.first_name,
    "last_name": this.props.last_name,
    "user_name":this.props.user_name,
    "password": this.props.password,
    "secretKey":values.secretKey,
    "email": this.props.email,
    "phone": this.props.phone,
    "dob": this,
    "college":1,
    "city": 1,
    "state": 1,
    "gender": "male",
    "image":"testImage"
            }
        )
        console.log(response)
      }
    });
  };

  handleConfirmBlur = e => {
    const { value } = e.target;
    this.setState({ confirmDirty: this.state.confirmDirty || !!value });
  };


  render() {
    const { current } = this.state;

    const { getFieldDecorator } = this.props.form;

    return (
                <Form onSubmit={this.handleSubmit}>


          <Form.Item label="Secret Key" extra="We must make sure that your are a valid user.">
          <Row gutter={8}>
            <Col span={12}>
              {getFieldDecorator('secretKey', {
                rules: [{ required: true, message: 'Please input the secret key you got!' }],
              })(<Input />)}
            </Col>
            <Col span={12}>
              <Button>Re-Send</Button>
            </Col>
          </Row>
        </Form.Item>
        <Button type="primary" htmlType="submit">
            Register
          </Button>
          <Button   onClick={this.props.previous}>
            Previous
          </Button>
        </Form>    

    );
  }
}
export const WrappedVerifyMail = Form.create({ name: 'register' })(VerifyMail);
